🇷🇺🇺🇦 Украинские СМИ со ссылкой на диписточник утверждают, что Россия на переговорах требовала:

▪️ признать ДНР и ЛНР в рамках Донецкой и Луганской областей;

▪️ закрепить на уровне парламента внеблоковый статус Украины и провести референдум;

▪️ провести денацификацию Украины

Ещё несколько важных заявлений Сергея Лаврова:

▫️ Для России неприемлемо то, что ядерное оружие США находится в Европе, пора вернуть его домой;

▫️ Трагедия Украины — результат попустительства западных покровителей образовавшегося там преступного режима;

▫️ Угроза новой гонки вооружений и превращения космоса в арену вооруженного конфликта обретает реальные черты;

▫️ Россия готова к работе с США по новым договоренностям в сфере стратегической стабильности

Мюнхенский филармонический оркестр уволил дирижера Валерия Гергиева, сообщает DPA. 

Ранее его концерты отменили в Карнеги-холле и Парижской филармонии.

