Новый брифинг от Минобороны РФ:

◽️Вооружённые силы ДНР и ЛНР продолжают наступление;

◽️С начала операции поражены 1146 объектов военной инфраструктуры Украины;

◽️Российская оперативно-тактическая авиация поразила шесть колонн бронетехники украинских вооружённых сил:

◽️Уничтожены 311 танков и других бронемашин, 42 самолёта и вертолёта, 51 реактивная система залпового огня, 147 орудий полевой артиллерии и минометов;

◽️За последние сутки ещё 110 украинских военнослужащих добровольно сложили оружие

🇺🇳 Главное из выступления постпреда РФ при ООН на новом заседании Генассамблеи:

◽️Действия России восстанавливают принципы Устава ООН на территории Донбасса и Украины, предотвращая мировую войну;

◽️США высокомерно отвергли сделанное РФ в декабре предложение о переговорах по безопасности;

◽️Нынешняя операция на Украине — это реализация права России на самооборону после заявлений Киева по ядерной тематике;

◽️Оккупация Украины в планы РФ не входит

Путин в телефоном разговоре с Макроном заявил, что урегулирование ситуации на Украине возможно только при учёте законных интересов России в сфере безопасности:

▫️ Признание российского суверенитета над Крымом;

▫️ Демилитаризация и денацификация украинского государства;

▫️ Обеспечение нейтрального статуса Украины

Заявления Минобороны РФ о жизни в населённых пунктах, перешедших под контроль российских вооруженных сил:

◽️Все населенные пункты продолжают жить в обычном режиме, функционируют объекты жизнеобеспечения, работает транспорт;

◽️Большинство администраций городов, по договорённости с командованием российских войск, осуществляют совместное обеспечение правопорядка и поддержание мира

Главное из заявлений Дмитрия Пескова:

🔹 Говорить об итогах и эффективности операции по демилитаризации Украины преждевременно, надо дождаться её завершения;

🔹 Действия украинских националистов, прикрывающихся мирными жителями, преступны;

🔹 Украина подвержена агрессивным, а зачастую преступным устремлениям, как это было в отношении ЛНР и ДНР;

🔹 Дмитрий Козак продолжит заниматься вопросами социального, гуманитарного и иного развития Донбасса;

🔹 Россия ответит на запрет на полёты российских авиакомпаний зеркально, но с учётом своих интересов;

🔹 Путин проведёт совещание по экономике с участием Мишустина, Белоусова, Силуанова, Набиуллиной и Грефа;

🔹 В России велась планомерная подготовка на протяжении длительного времени к возможным санкциям, включая самые тяжелые

«Защитники грёбаные, тикают ****. Вот так доблестная армия Украины прячется среди школ». 

Техника ВСУ стоит в жилых кварталах.

