Вечерний брифинг Минобороны РФ по спецоперации в Донбассе. 

Российские военные уничтожили:
67 танков;
16 реактивных систем залпового огня;
87 единиц специальной военной автомобильной техники.

Захвачены американские противотанковые ракетные комплексы Javelin и британские NLAW.

Минобороны России провело новый брифинг по спецоперации на Украине. Стало известно о выведении из строя 118 военных объектов ВСУ, среди них:

11 военных аэродромов;
13 пунктов управления и узлов связи ВС;
14 ЗРК противовоздушной обороны;
5 боевых самолётов;
1 вертолёт;
5 беспилотников;
18 танков;
7 реактивных систем залпового огня;
41 автомобиль;
5 боевых катеров.

🇺🇸 Выступление Джо Байдена по ситуации на Украине, главное:

◽️Войска США не будут участвовать в конфликте на Украине;

◽️Путин — агрессор, Путин выбрал войну;

◽️НАТО разместит новые силы в Европе;

◽️Россия отвергла все попытки США по разрешению ее озабоченностей в сфере безопасности;

◽️Мы ограничим возможности России вести бизнес в долларах, фунтах и йенах;

◽️США вводят блокирующие санкции против ВТБ;

◽️Страны G7 договорились ограничить возможности РФ в сфере высоких технологий, санкции могут затронуть до половины импорта России;

◽️Новые санкции США коснутся российской космической программы и фондов крупнейших российских госкомпаний

«Если вы понимаете, что нападаете на независимую страну, то выходите на площади и требуйте закончить войну»

Владимир Зеленский выступил с обращением о ситуации на Украине:

▫️Гул авиации — это звук железного занавеса, который закрывает Россию от цивилизованного мира;

▫️Задача украинцев, чтобы этот занавес проходил «дома у россиян»;

▫️ВСУ остановили наступление России;

▫️Наибольшие проблемы на юге страны — там сейчас идут бои за Херсон;

▫️На севере страны российская армия продвигается очень медленно; 

▫️В плен взяты российские военные, врачи оказывают им медицинскую помощь;

▫️Уничтожено много российской авиации и бронетехники; 

▫️Россия превращается в аналог ДНР;

▫️Россияне заявили, что они против войны с Украиной

Заявления официального представителя МИД России Марии Захаровой:

▪️Эвакуация российских дипломатов из Украины полностью завершилась;

▪️Спецоперация РФ на территории Украины является не началом войны, а её предотвращением;

▪️Россия получила отказ США от переговоров ещё до начала операции на Украине, ответ Вашингтона был оформлен в хамской манере

Заявления Дмитрия Пескова по ситуации на Украине:

◽️Цели были сказаны президентом — демилитаризация и денацификация Украины. Собственно и то, и другое представляет угрозу для нашего государства и народа;

◽️Сроки российской операции по демилитаризации Украины будут определяться Путиным и зависеть от ее результативности, целесообразности;

◽️Слово «оккупация» в отношении специальной военной операции по демилитаризации неприменимо;

◽️Смена режима на Украине — вопрос выбора украинского народа;

◽️Судя по опросам, россияне поддерживают спецоперацию по демилитаризации Украины не меньше, чем признание ДНР и ЛНР

В Минобороны прошёл брифинг по военной операции в Донбассе:

▪️СБ Украины готовит и уже реализует провокации по известным лекалам «Белых касок»;

▪️Данные разведки показывают, что отдельные подразделения и военнослужащие ВСУ массово покидают занимаемые позиции;

▪️Народная милиция ДНР и ЛНР перешла в контрнаступление при огневой поддержке российских вооруженных сил

Главное из обращения Владимира Путина:

▪️В планы России не входит оккупация Украины;

▪️Россия не хочет допустить появления ядерного оружия у Украины и видит угрозу в освоении Украины силами НАТО;

▪️Россия стремится к демилитаризации Украины;

▪️Путин призывает украинских военных сложить оружие и идти домой;

▪️Вся ответственность за возможное кровопролитие будет целиком и полностью на совести правящего на Украине режима;

▪️Мы готовы к любому развитию событий. Все необходимые в этой связи решения приняты

Постпред России Василий Небензя выступил на Генассамблее ООН по ситуации с ДНР и ЛНР:

▫️РФ признала ДНР и ЛНР, убедившись в безнадежности ситуации в условиях неприкрытого геноцида;

▫️Признание Россией независимости ЛНР и ДНР — следствие саботажа Киевом взятых им обязательств;

▫️Киеву нужны не жители Донбасса, а только их земля;

▫️Киев с самого начала вынашивал план реванша в отношении Донбасса, надежда на диалог теплилась, но «майданная власть» таких намерений не имела;

▫️ЛНР и ДНР не уходили от выполнения минских соглашений, ожидая для себя особого статуса, надеждам не суждено было сбыться;

▫️В Россию прибыли 96 тысяч беженцев с Донбасса;

▫️Конфликт на востоке Украины далеко не исчерпан, но с нарушителями режима прекращения огня в Донбассе «либеральничать никто не станет»

Футбольный клуб ЦСКА попал под санкции США, так как находится в структуре ВЭБ.

