🇺🇸 Выступление Джо Байдена по ситуации на Украине, главное:

◽️Россия своими последними действиями начала вторжение на территорию Украины;

◽️Санкции против РФ коснутся суверенного долга и российских элит;

◽️США продолжат оказывать помощь Украине в оборонной сфере;

◽️Если Россия не выведет войска из Белоруссии, НАТО усилит свою военную группировку в Прибалтике;

◽️У нас нет намерений сражаться с Россией, но мы будем защищать всех членов НАТО;

◽️США работают с Германией над тем, чтобы «Северный поток 2» не был запущен;

◽️Санкции против России ударят по США:

◽️США и союзники готовы к диалогу и надеются, что дипломатия поможет достичь нужных целей

Минобороны РФ сделало несколько важных заявлений по поводу ситуации в ДНР и ЛНР:

▪️ Россия будет принимать все доступные меры для устранения угрозы миру в Донбассе; 

▪️ Ситуация в Донбассе обостряется, мы должны взять жителей под защиту;

▪️ На границах ДНР и ЛНР Украина создала 60-тысячную группировку;

▪️ Представитель Минобороны попросил поддержать обращение Путина и разрешить использовать вооруженные силы России за её пределами

Владимир Зеленский выступил с обращением по поводу признания Россией независимости ЛНР и ДНР. Главное:

🔹 Признание независимости ЛНР и ДНР означает односторонний выход РФ из минских соглашений;

🔹 Действия РФ являются нарушением территориальной целостности Украины;

🔹 Международные признанные границы Украины останутся такими же

🔹 Киев стремится к миру дипломатией, оставляя право на самооборону;

🔹 Зеленский инициировал экстренное заседание «Нормандской четверки»

В «Шереметьево» встретили «золотой рейс» с российскими олимпийцами. 

Из Пекина вернулись обладатель трех золотых медалей лыжник Александр Большунов, олимпийская чемпионка Анна Щербакова, хоккеисты, взявшие серебро, и другие спортсмены. 

